          <div>
            <img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" style={{ width: '100%', height: '100%' }} />
          </div>
        </Carousel>
      }
    >
      <Meta title="Europe Street beat" description="www.instagram.com" />
    </Card>
  </div>
);

export default App;
